module.exports = [{
        'type': 'markdown',
        'content': 'The HTML plugin allows for testing of components, and for compiling pages.\nIt is a wrapper around HtmlWebpackPlugin.\n\nBy default  looks first for a  public/index.js to bootstrap your app, if it\ndoes not exist, than it uses a synthetic file that looks like\n\n```js\n    <span class="hljs-keyword">import</span> React <span class="hljs-keyword">from</span> <span class="hljs-string">\'react\'</span>;\n    <span class="hljs-keyword">import</span> {render} <span class="hljs-keyword">from</span> <span class="hljs-string">\'react-dom\'</span>;\n    <span class="hljs-keyword">import</span> App <span class="hljs-keyword">from</span> <span class="hljs-string">\'your-module\'</span>;\n    render(<span class="xml"><span class="hljs-tag">&lt;<span class="hljs-name">App</span>/&gt;</span></span>, <span class="hljs-built_in">document</span>.getElementById(<span class="hljs-string">\'content\'</span>))\n```\n\nMore than likely you should write your own render component, that looks\nsimilar\n\n### Configuration\n\nIn package.json\n\n```json\n "name":"your_component",\n ...\n "mrbuilder":{\n    "plugins":[\n        "mrbuilder-plugin-html"\n    ]\n }\n```\n\n### Custom Element\n\nTo configure which element your component renders to use elementId property,\nwhere the value is the dom Id. By default it is "content".\n\n## Hot loading\n\nHot loading setup is always a PNA -- this attempts to make it easier, however\nto do this your "App" must export a class rather than the traditional export.\n\nThis can be controlled via the exported flag either per "page" or for all "pages".\n\n## Custom Hot Loading\n\nIf exported is false, than you will need to set hot loading in your page, and your\nrunning hot [see](https://github.com/gaearon/react-hot-loader) step 4.  The\nrest of the steps are already done for you.\n\nAn example can be found [here](https://github.com/jspears/mrbuilder/tree/master/example/example-multi-app);\n\nIt should look something like.\n\n```json\n"mrbuilder":{\n    "plugins":[\n        ["mrbuilder-plugin-html", {exported:false}]\n    ]\n }\n```\n\nYour entry point should look something like.\n\n```js\n<span class="hljs-comment">// main.js</span>\n<span class="hljs-keyword">import</span> React <span class="hljs-keyword">from</span> <span class="hljs-string">\'react\'</span>\n<span class="hljs-keyword">import</span> ReactDOM <span class="hljs-keyword">from</span> <span class="hljs-string">\'react-dom\'</span>\n<span class="hljs-keyword">import</span> { AppContainer } <span class="hljs-keyword">from</span> <span class="hljs-string">\'react-hot-loader\'</span>\n<span class="hljs-keyword">import</span> App <span class="hljs-keyword">from</span> <span class="hljs-string">\'./containers/App\'</span>\n\n<span class="hljs-keyword">const</span> render = <span class="hljs-function"><span class="hljs-params">Component</span> =&gt;</span> {\n  ReactDOM.render(\n    <span class="xml"><span class="hljs-tag">&lt;<span class="hljs-name">AppContainer</span>&gt;</span>\n      <span class="hljs-tag">&lt;<span class="hljs-name">Component</span> /&gt;</span>\n    <span class="hljs-tag">&lt;/<span class="hljs-name">AppContainer</span>&gt;</span></span>,\n    <span class="hljs-built_in">document</span>.getElementById(<span class="hljs-string">\'root\'</span>),\n  )\n}\n\nrender(App)\n\n<span class="hljs-comment">// Webpack Hot Module Replacement API</span>\n<span class="hljs-keyword">if</span> (<span class="hljs-built_in">module</span>.hot) {\n  <span class="hljs-built_in">module</span>.hot.accept(<span class="hljs-string">\'./containers/App\'</span>, () =&gt; {\n    render(App)\n  })\n}\n```\n\n### Pages\n\nThe pages points can be configured via pages object where the key will match\nthe entry point, or by default it will look into public/index.js, failing that\nit will use the main defined in your package.json.\n\n```js\n<span class="hljs-string">"mrbuilder"</span>:[\n[\n        <span class="hljs-string">"mrbuilder-plugin-html"</span>,\n        {\n          <span class="hljs-string">"pages"</span>: {\n            <span class="hljs-string">"index"</span>: {<span class="hljs-comment">//"index will match your entry for index.</span>\n              <span class="hljs-string">"title"</span>: <span class="hljs-string">"Index"</span> <span class="hljs-comment">// will set the title for the page.</span>\n            },\n            <span class="hljs-string">"other"</span>: {\n              <span class="hljs-string">"title"</span>: <span class="hljs-string">"Other"</span>,\n              <span class="hljs-string">"exported"</span>: <span class="hljs-literal">true</span> <span class="hljs-comment">// will tell the html plugin to create a real entry point and setup loading for this.</span>\n            }\n          }\n        }\n      ]\n]\n```'
    }]
	

